        id: "333",
        author: "Helium blockchain",
        title: "顺势而为：为什么我们从一开始就相信Helium做的是对的",
        releaseTime: "2020-12-12",
        content: `<p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;Helium是RAK的重要合作伙伴，其总部位于美国旧金山,<span style="text-decoration: underline;">是世界上第一个使用点对点技术的无线网络，由消费者拥有、运营，并为受众提供基于使用定价、保护隐私安全的数据传输。</span></p>
        <p style="text-align: center;"><span style="text-decoration: underline;"><strong>Helium从根源解决了IoT网络建设问题</strong></span></p>
        <p>&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;我们认为，通信的未来在于分散的网络，而Helium解决了一个基于IoT网络建设的问题。</p>
        <p style="padding-left: 40px;text-align: center;"><img class="wscnph" src="data:image/png;base64," /></p>
        <p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;RAK与Helium第一次接触始于2019年初，我们在阅读Helium的博客后，非常认同其对IoT产品模式和商业模式的分析：未来的IoT网络不是传统以运营商为中心而是去中心化的网络建设。</p>
        <p>我们从Helium的博客中了解到，运营商的商业模式基于负责基础通信网络建设，其特点是中心化，收入模式可以理解成架桥收费，若产生了大量数据，则意味着在高速公路有更多的车辆，过路费会收得更多，即网络处理的数据越多，赚的钱就多，这样的模式在2G/3G/4G网络不会存在问题。</p>
        <p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;但是，在IoT网络中，连接对象是物，特别是LPWA(低功耗广域网)，数据传输非常少的，而且不经常传输，通常情况在报警后才会发送，或者一天定期发送几次，这就让运营商占主动的网络建设者在评估网络建设的决心上大打折扣。</p>
        <p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;Helium的博客透露，很多大型私网运营商通过募资去建设中心化的网络；但是，鉴于成本太高，且网络周期长，在过去的几年中，很多尝试都失败了。</p>
        <p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;如何在不构建基础设施的情况下构建网络？它不同于软件开发，不像在PC上安装软件并将其与Internet上的其他计算机互连那样容易，鉴于软件中使用的快速原型设计/开发/安装模型在 IoT 世界中无法扩展，许多部件需要与驱动程序和软件层互连。</p>
        <p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;Helium认为，无论是以运营商或以私网运营商为主导的中心化IoT网络建设在过去几年的尝试都证明是失败的。</p>
        <p style="text-align: center;"><strong>连接性是关键</strong></p>
        <p>&nbsp;</p>
        <p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;俗话说外行看热闹，内行看门道。在对关键IoT技术的核心理解上，业界专家和外行们达成了共识：连接至关重要，也成为阻碍物联网前景成为现实的关键障碍。</p>
        <p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;Helium尝试了多种方法解决IoT的问题，据其博客描述，Helium基于其创始团队的软件背景，其认为 IoT中连接协议非常重要，试图统一标准也异常困难；这一切源于IoT的场景太分散，用户使用场景的不同会导致需要不同的连接协议作为应用的技术手段。另外，他们很快发现IoT不想发生改变。</p>
        <p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;Helium凭借其在软件开发方面的经验迅速在网络部署中抢占先机，即过去使用的快速开发，原型设计，连续迭代类型方法论以及利用成熟的软件堆栈（使他们专注于最终应用程序）也可以应用于网络部署。</p>
        <p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;然而，实际情况并非如此。从Helium本身属性研究发现，新方法需要所有形式的硬件（传感器、通信模块和连接）各自形成一套不同的技能和方法。</p>
        <p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;但如Helium看到和我们了解的，创建基础结构是一个复杂的过程。它不仅需要硬件设施也需要人的参与，即通过使其网络可访问，确保每个对此事感兴趣的人都能从中获得利益，同时为网络的发展贡献力量。</p>
        <p>&nbsp;</p>`
